        <div>
            <Segment inverted>
                <Menu inverted secondary>
                    <Menu.Item
                        name='home'

                    />
                    <Menu.Item
                        name='messages'
                    />
                    <Menu.Item
                        name='friends'
                    />
                </Menu>
            </Segment>
        </div>
    );

}
